import Footer from '../components/Layouts/Footer';

class Services extends Component {
    render() {
        return (
            <React.Fragment>
                <Navbar />
                <PageBanner 
                    pageTitle="Servicii oferite" 
                    homePageUrl="/" 
                    homePageText="AcasÄƒ" 
                    activePageText="Servicii oferite" 
                /> 
                <ServicesStyleOne />
                <Footer />
            </React.Fragment>
        );
    }
}

export default Services;
